import { NAME, ADD } from '/home/ksolves/Documents/sujeet/training/ReactJs/redux-app/src/action_type/index.js';

const update_name = (state = [], { type, payload }) => {
  switch (NAME) {
    case NAME:
      return "John Donne";
    default:
      return null;
  }
}

const update_add = () => {
  switch (ADD) {
    case ADD:
      return "Delhi";
    default:
      return null;
  }
}

export {update_name,update_add};
